// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract CampaignTypesTokenERC20 is ERC20Upgradeable, OwnableUpgradeable {
    // Constructor
    function initialize(
        string memory name,
        string memory symbol,
        uint256 initialSupply
    ) public initializer {
        __ERC20_init(name, symbol);
        __Ownable_init();
        _mint(msg.sender, initialSupply);
    }

    // Mint additional tokens (only owner)
    function mint(address account, uint256 amount) external onlyOwner {
        _mint(account, amount);
    }

    // Burn tokens (only owner)
    function burn(address account, uint256 amount) external onlyOwner {
        _burn(account, amount);
    }
}

contracts/FactoryToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import {Clones} from "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

import "./CampaignTypesTokenERC20.sol";

contract FactoryToken {
    address public campaignTypesTokenERC20Template;

    constructor(address _campaignTypesTokenERC20Template) {
        campaignTypesTokenERC20Template = _campaignTypesTokenERC20Template;
    }

    function createNewCampaign(
        string memory _name,
        string memory _symbol
    ) external returns (address) {
        address newCampaign = Clones.clone(campaignTypesTokenERC20Template);

        // Initialize the campaign
        CampaignTypesTokenERC20(newCampaign).initialize(
            _name,
            _symbol,
            1000000000000000000000000000
        );

        // Transfer ownership to the caller of this function
        Ownable(newCampaign).transferOwnership(msg.sender);

        return newCampaign;
    }
}

